import React from 'react';

const Card = (data) => (
    <div className='card'>
    {console.log(data)}
        <div className='card__picture'>
            <img src={data.img} alt={data.name}/>
        </div>
        <p className='card__text'>{data.name}</p>
        <p className='card__text'>{data.cost}</p>
    </div>
)

export default Card;
